import React from 'react'

export default function ClientCommentItem(props) {


const {image, comment} = props;


    return (
        <div className="Clients-Comment">

                
                <div className="quote quote-right"> <i class="fas fa-quote-right"></i> </div>

                <div className="image"> <img src={`${window.location.origin}/Images/${image}`} alt="" />  </div>
                <div className="Client-name"> <p className="name"> Mohabbat Shikder Kowshik </p> <p className="identity"> --- Web developer in digital market  </p>  </div>

                <div className="comment">
                    <div className="quote quote-left"> <i class="fas fa-quote-left"></i> </div>
                    <p>
                        {comment}
                    </p>
                </div>
        </div>
    )
}
